import { Component } from "react";
import React from "react";

class Content extends Component {

  state = {
    loading: true
  }


  render() {
    return (
      <div>
        <div>Please select your card type.
          <select onChange>
          <option value="">-</option>
            <option value="credit">Credit</option>
            <option value="debit">Debit</option>
          </select>
          <table>
            <thead>
              <tr>
                 <th>Date</th>
                 <th>Transaction</th>
                 <th>Amount</th>
               </tr>
             </thead>
             <tbody id="myTable">
             </tbody>
            </table>
        </div>
      </div>
    );
  }
}

export default Content;
